const App = () => {

  const client_id=`cdf04b05665f0efd4eb7272c93633384cae55bb23a0833102eee61692ebda4fd`;

  let url = `https://api.unsplash.com/search/photos/?client_id=${client_id}&query=mountains`;

  const [images, setImages] = useState([]);

  fetch(url)
    .then(function (data){
      return data.json()

    })
    .then(function(data){
      console.log(data.results);
      setImages(data.results);
    })

  return (
    <div className="App">   
          Learn React      
    </div>
  );
}

export default App;
